import React from "react";
import Layout from "../components/Layout";
import style from "../pages/index.module.scss";
import { loginUser } from "../server/controllers/fauthContoller";

class login extends React.Component {
  state = {
    email: "",
    password: "",
    data: {},
  };

  handleChange = (event) => {
    this.setState({ [event.target.name]: event.target.value });
  };

  handleSubmit = (event) => {
    event.preventDefault();

    const { email, password } = this.state;
    loginUser.then((data) => {
      this.setState({ data });
    });
    console.log(this.state);
  };

  render() {
    return (
      <Layout>
        <section class="siginin" id="signin">
          <a href="/" class="siginin__sitename" id="sitename">
            iguyra <span>&larr;</span>
          </a>
          <form class="siginin__form" onSubmit={this.handleSubmit} action="">
            <label class="siginin__label" for="email">
              email
              <input
                class="siginin__input"
                name="email"
                type="email"
                id="email"
                placeholder="eg: res@res.com"
                onChange={this.handleChange}
              />
            </label>
            <label class="siginin__label" for="password">
              password
              <input
                class="siginin__input"
                name="password"
                type="password"
                id="password"
                placeholder="type password"
                onChange={this.handleChange}
              />
            </label>

            <button class="siginin__button">login</button>

            <div class="siginin__details">
              <a class="siginin__passwordforgot" href="#">
                forgot your password ?
              </a>
              <a class="siginin__register" href="/signup" id="createaccount">
                create an account
              </a>
            </div>
          </form>
        </section>
      </Layout>
    );
  }
}

export default login;
